import React, { useState, useEffect } from "react";

export default props => {
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    setLoading(false);
  }, []);

  let results = loading ? (
    <p>Loading...</p>
  ) : (
    <div>
      <h1>test</h1>
    </div>
  );
  return results;
};
